import React from "react";
import '../assets/css/TwoItem.css';
import ItemPro2 from './ItemPro2';
import PayCenter from '../components/PayCenter';
import ItemDivide from '../components/ItemDivide';
class TwoItem extends React.Component {
  // componentDidMount() {
  //   document.title = '开发中';
  //  }

  render() {
    const { itemData } = this.props;
    const dataProps=[];
    if(itemData&&itemData['goods_list']){
      let listData=itemData['goods_list'];
      for (let index = 0; index < listData.length; index++) {
        const imgUrl = listData[index]['image'];
        const oldPrice = listData[index]['price'];
        const title = listData[index]['title'];
        const url = listData[index]['url'];
        dataProps[index]={imgUrl,oldPrice,url,title};
      }
    }
    let totalPrice=itemData&&itemData['official_receipts']?itemData['official_receipts']:0.00;
    return (
      <div className="TwoItemMain">
        <div className="TwoItembox">
          <div className="left"><ItemPro2 isMain={this.props.fixMain?true:false} {...dataProps[0]}/></div>
          <div className="center"><img src="/images/add.png" alt="add"/></div>
          <div className="right"><ItemPro2 {...dataProps[1]}/></div>
        </div>
        <PayCenter price={totalPrice}/>
        <ItemDivide/>
      </div>
    );
  }
}

export default TwoItem;
